import React from 'react';

function Contact() {
    return (
        <footer>
            <a name = "Contact"></a>
            <ul>
                <li>Email: <a href="mailto:jesse.ren@uwaterloo.ca" target="_top"><u>jesse.ren@uwaterloo.ca</u></a></li>
                <li>Phone: (647)868-3423</li>
                <li>LinkedIn: <a href="https://www.linkedin.com/in/jesse-ren/" target="_blank" rel="noopener noreferrer"><u>linkedin.com/in/jesse-ren</u></a></li>
            </ul>
        </footer>
    )
}

export default Contact;
